import Vue from 'vue'
import AppNavbar from "./AppNavbar";
import AppHeader from "./AppHeader";
import AppFooter from "./AppFooter";

Vue.component("AppNavbar", AppNavbar)
Vue.component("AppHeader", AppHeader)
Vue.component("AppHeader", AppFooter)

export default {
    components: {
    AppNavbar,AppHeader
    }
  }
